  `course_desc` text CHARACTER SET utf8 COLLATE utf8_general_ci COMMENT '科目介绍',
  `course_icon` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '科目图标',
  `course_cover` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '科目封面',
  `show_type` int DEFAULT NULL COMMENT '展示类型',
