  `unit_intro` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '单元简介',
  `unit_cover` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '课程封面',
  `course_id` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '课程外键ID',
  `course_video` text CHARACTER SET utf8 COLLATE utf8_general_ci COMMENT '课程视频',
  `course_video_source` tinyint DEFAULT '1',
  `show_course_video` tinyint DEFAULT '1' COMMENT '对学生显示课程视频',
  `course_case` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '课程作业案例',
  `show_course_case` tinyint DEFAULT '1' COMMENT '对学生显示课程案例',
  `course_ppt` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '课件PPT',
