  `course_work_answer` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '课程作业答案',
  `course_plan` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '教案',
  `show_course_plan` tinyint DEFAULT '0' COMMENT '对学生显示教案',
  `map_x` int DEFAULT NULL COMMENT '地图X坐标',
