  `internal_or_external` tinyint(1) DEFAULT NULL COMMENT '外链菜单打开方式 0/内部打开 1/外部打开',
  `is_route` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否路由',
  `hidden` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否隐藏',
